// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

interface IPancakeRouter {
    function factory() external pure returns (address);
    function WETH() external pure returns (address);
    function addLiquidityETH(
        address token,
        uint amountTokenDesired,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external payable returns (uint amountToken, uint amountETH, uint liquidity);

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external;
}

contract PalaemonCoin is ERC20, Ownable, ReentrancyGuard {
    using Address for address;

    address public charityWallet;
    address public devWallet;
    IPancakeRouter public router;

    mapping(address => bool) public isExcludedFromFees;

    bool private inSwapAndLiquify;
    bool public swapAndLiquifyEnabled = true;

    uint256 public numTokensSellToAddToLiquidity = 10_000 * 10**18;

    modifier lockTheSwap {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }

    constructor(
        address _owner,
        address _charityWallet,
        address _devWallet,
        address _routerAddress
    ) ERC20("Palaemon Coin", "PAL") Ownable(_owner) {
        require(_charityWallet != address(0), "Invalid charity wallet");
        require(_devWallet != address(0), "Invalid dev wallet");
        require(_routerAddress != address(0), "Invalid router address");
        charityWallet = _charityWallet;
        devWallet = _devWallet;
        router = IPancakeRouter(_routerAddress); // <-- Set router here
        _mint(_owner, 1_000_000_000 * 10 ** decimals());
        // Do NOT call _approve with address(router) until after this line!
        isExcludedFromFees[_owner] = true;
        isExcludedFromFees[address(this)] = true;
        isExcludedFromFees[_charityWallet] = true;
        isExcludedFromFees[_devWallet] = true;
    }

    function _update(address from, address to, uint256 amount) internal override {
        if (inSwapAndLiquify || isExcludedFromFees[from] || isExcludedFromFees[to]) {
            super._update(from, to, amount);
            return;
        }

        uint256 charityFee = (amount * 2) / 100;
        uint256 devFee = (amount * 1) / 100;
        uint256 liquidityFee = (amount * 2) / 100;
        uint256 totalFee = charityFee + devFee + liquidityFee;

        uint256 transferAmount = amount - totalFee;

        super._update(from, address(this), totalFee);
        super._update(from, to, transferAmount);

        _sendToWallets(charityFee, devFee);

        if (balanceOf(address(this)) >= numTokensSellToAddToLiquidity && swapAndLiquifyEnabled) {
            swapAndLiquify();
        }
    }

    function _sendToWallets(uint256 charityAmount, uint256 devAmount) private {
        uint256 total = charityAmount + devAmount;
        uint256 balance = balanceOf(address(this));
        if (total > 0 && balance >= total) {
            super._update(address(this), charityWallet, charityAmount);
            super._update(address(this), devWallet, devAmount);
        }
    }

    function swapAndLiquify() private lockTheSwap nonReentrant {
        uint256 contractTokenBalance = balanceOf(address(this));

        uint256 liquidityTokens = contractTokenBalance / 2;
        uint256 tokensToSwap = contractTokenBalance - liquidityTokens;

        uint256 initialBalance = address(this).balance;

        _approve(address(this), address(router), tokensToSwap);

        // ✅ Declare the path array correctly
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = router.WETH();

        router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokensToSwap,
            0,
            path,
            address(this),
            block.timestamp
        );

        uint256 newBalance = address(this).balance - initialBalance;

        _approve(address(this), address(router), liquidityTokens);
        router.addLiquidityETH{value: newBalance}(
            address(this),
            liquidityTokens,
            0,
            0,
            owner(),
            block.timestamp
        );
    }

    // ==== Owner Admin Controls ====

    function setCharityWallet(address _wallet) external onlyOwner {
        require(_wallet != address(0), "Invalid address");
        charityWallet = _wallet;
    }

    function setDevWallet(address _wallet) external onlyOwner {
        require(_wallet != address(0), "Invalid address");
        devWallet = _wallet;
    }

    function setExcludedFromFees(address account, bool excluded) external onlyOwner {
        isExcludedFromFees[account] = excluded;
    }

    function setSwapAndLiquifyEnabled(bool enabled) external onlyOwner {
        swapAndLiquifyEnabled = enabled;
    }

    function setNumTokensSellToAddToLiquidity(uint256 amount) external onlyOwner {
        numTokensSellToAddToLiquidity = amount * 10**18;
    }

    receive() external payable {}
}

